import React from 'react';
import Square from './sqaure';

const Board = () => {
    return (
       <>
       <div className="board-row">
        <Square/>
        <Square/>
        <Square/>
       </div>
       <div className="board-row">
        <Square/>
        <Square/>
        <Square/>
       </div>
       <div className='board-row'>
        <Square/>
        <Square/>
        <Square/>
       </div>
       </>
    );
}

export default Board;
